    def changeNumOfBuys(self):
        if self.num_of_buys_number != 3:
            self.num_of_buys_label.setText("x" + self.num_of_buys_list[self.num_of_buys_number + 1])
            self.num_of_buys_number += 1
        else:
            self.num_of_buys_label.setText("x" + self.num_of_buys_list[0])
            self.num_of_buys_number = 0

        for label in self.num_of_buys_label_list:
            label.setText("Buy x" + self.num_of_buys_list[self.num_of_buys_number])
